U8 precis_ctx_lookup(U32 cp)
{
    if ((cp & 0x00FFFE) == 0x00FFFE || 0x040000 <= cp)
	return 0;

    return precis_ctx_array[precis_ctx_index[cp >> 7] +
			    (cp & ((1 << 7) - 1))
	];
}

